import e from "cors";
import React, { Fragment, useEffect, useState } from "react";
import './RegStyles.css'




function RegServicePage() {
    const [service, setService] = useState({
        detalle : "",
        valor : 0,
        estado : "Inactivo" });
    
    const getServices = async ()=> {
        try {
    const response = await fetch("http://localhost:3001/add-service");
    const jsonResponse = await response.json();
    const ResponseServices = jsonResponse.data;
           

        

    } catch(error) {
       console.log(error);
     }
 };

 
 const handleChange = e =>{
    setService({
        ...service,
        [e.target.name]: e.target.value
    })
}  
useEffect(() => {
    getServices();
},)   
function cambiaColor() { 
    var i 
    for (i = 0; i < document.fcolores.colorin.length; i++){ 
       if (document.fcolores.colorin[i].checked) {
          break; 
      }
    } 
    document.bgColor = document.fcolores.colorin[i].value 
} 
    
    
    return (

        <Fragment>


            <h2 class="te">GESTIÃ“N DE SERVICIOS</h2>
            <div className="row">
                <div className="col ">
                    <a class="texti0 te0">Registro de Servicios</a>
                </div>
            </div>
            <hr class="lin"></hr>
            <div class="basic_info recuadro">
                <div className="row">
                    <div class="col drp">
                        
                    </div>
                    <div className="col">
                        <div class="input-group mb-3">
                            <input  name = "Detalle" onChange = {handleChange} type="text" class="form-control intu" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default " placeholder="Detalle" />
                        </div>
                    </div>
                </div>
                <div class="mb-3 row">
            <label for="inputNombre" class="col-sm-2 col-form-label valor" >Valor</label>
            <div class="col-sm-8">
                <input  name = "valor" onChange = {handleChange}type="number" class="form-control pesos" id="inputNombre"placeholder="$"/>
            </div>
            </div>
            <div class="mb-3 row">
            <div class="form-check radi">
                <input name = "Estado" onChange = {handleChange} class="form-check-input" type="radio" name="flexRadioDefault" id="flexRadioDefault1" onclick = "activar()"/>


                <label class="form-check-label" for="flexRadioDefault1">
                    Activo
                </label>
            </div>
            <div class="form-check radi">
                <label class="form-check-label" for="flexRadioDefault2">
                    No Activo
                </label>
                <input name = "Estado" onChange = {handleChange} class="form-check-input" type="radio" name="flexRadioDefault" id="flexRadioDefault2" onclick = "activar()" checked/>

            </div>
        </div>

            </div>
            <button type="button" class="btn btn-primary but2" data-bs-toggle="modal" data-bs-target="#staticBackdrop">Guardar</button>


{/* <-- Modal --> */}
<div class="modal fade" id="staticBackdrop" data-bs-backdrop="static" data-bs-keyboard="false" tabindex="-1" aria-labelledby="staticBackdropLabel" aria-hidden="true">
  <div class="modal-dialog">
    <div class="modal-content">
      <div class="modal-header">
        <h5 class="modal-title" id="staticBackdropLabel">Guardar servicio</h5>
        <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
      </div>
      <div class="modal-body">
        ...
      </div>
      <div class="modal-footer">
        <button type="button" class="btn btn-secondary" data-bs-dismiss="modal">Cancelar</button>
        <button type="button" class="btn btn-primary">Guardar</button>
      </div>
    </div>
  </div>


</div>

            <hr class="lin"></hr>
        </Fragment>
    )
}

export default RegServicePage;
